import { useState, useEffect } from "react";
import axios from "axios";
import styles from "../CSS/Crops.module.css";

function ApplicationsAdminUI() {
  const [data, setData] = useState();

  useEffect(() => {
    axios.get("http://localhost:3002/applications").then((res) => {
      if (res.data != false) {
        console.log(res.data);
        setData(res.data);
      } else console.log("applications fetch fail");
    });
  }, []);
  return (
    <div>
      {data && (
        <div>
          {data.map((x) => (
            <table key={x._id} className={styles.table}>
              <tbody>
                <tr>
                  <td>Name:</td>
                  <td>{x.name}</td>
                </tr>
                <tr>
                  <td>Type:</td>
                  <td>{x.cropType}</td>
                </tr>
                <tr>
                  <td>Suitable Soil:</td>
                  <td>{x.suitableSoil}</td>
                </tr>
                <tr>
                  <td>Suitable Climate:</td>
                  <td>{x.suitableClimate}</td>
                </tr>
                <tr>
                  <td>Suitable Season:</td>
                  <td>{x.suitableSeason}</td>
                </tr>
              </tbody>
            </table>
          ))}
        </div>
      )}
    </div>
  );
}

export default ApplicationsAdminUI;
